import React from "react";
import "./ResultsList.css"; // Add CSS file

export const ResultsList = ({ results }) => {
  const handleClick = (album) => {
    alert(`You clicked on: ${album.title} by ${album.artist}`);
    // You can later replace this with navigation or modal display
  };

  return (
    <div className="results-list">
      {results.map((album) => (
        <div
          key={album.id}
          className="result-item"
          onClick={() => handleClick(album)}
        >
          <h4>{album.title}</h4>
          <p>{album.artist}</p>
          <p className="date">{album.firstReleaseDate}</p>
        </div>
      ))}
    </div>
  );
};
